import React from 'react';

import { StyledHandleContainer, StyledHandleWrapper } from './StyledComponents';

interface HandleProps {
  domain: number[];
  handle: {
    id: string;
    value: number;
    percent: number;
  };
  getHandleProps: (id: string) => any;
}

const Handle: React.FC<HandleProps> = ({
  domain: [min],
  handle: { id, value, percent = 0 },
  getHandleProps,
}) => {
  const leftPosition = `${percent}%`;

  return (
    <>
      {/* StyledHandleWrapper와 StyledHandleContainer를 하나의 컴포넌트로 합칩니다 */}
      <div
        className="combined-handle" // CSS 클래스를 적절히 설정하세요
        role="slider"
        aria-valuemin={min}
        aria-valuenow={value}
        style={{ left: leftPosition }}
        {...getHandleProps(id)}
      />
    </>
  );
};

export default Handle;
